#include <iostream>
#include <string>
#include "mex.h"
#include "matrix.h"
#include <Eigen/Eigen>
void mexFunction (int _no_op_args, mxArray *mex_op[], int _no_ip_args, const mxArray *mex_in[] )
{
    /////////////////// DECLARATIONS ///////////////////////////////////
    // I/O variables

    /////////////////// INPUT ///////////////////////////////////
    char* query = mxArrayToString(mex_in[0]);
    std::string str(query);
    std::string query_type = query;
    double *ptr_free_links = mxGetDoubles(mex_in[1]);
    int dof = GetNumJoints();

    // Solving FK
    if (query_type.compare("FK")==0)
    {
        Eigen::Map<Eigen::ArrayXXd,Eigen::Aligned> _joint_config (mxGetPr(mex_in[2]),dof,1);
        IkReal joint_config[dof];
        for (int i=0; i<dof; i++)
            joint_config[i] = _joint_config(i);
        
        // Convert to IKfast datatypes
        // FK
        IkReal rotation[9],translation[3];
        ComputeFk(joint_config, translation, rotation);
        Eigen::Matrix4d tf;
        tf << rotation[0], rotation[1], rotation[2], translation[0],
            rotation[3], rotation[4], rotation[5], translation[1],
            rotation[6], rotation[7], rotation[8], translation[2],
            0, 0, 0, 1;
        
        /////////////////// OUTPUT ///////////////////////////////////
        mex_op[0] = mxCreateDoubleMatrix(4,4, mxREAL);
        Eigen::Map<Eigen::ArrayXXd,Eigen::Aligned> M0 (mxGetPr(mex_op[0]),4,4);
        M0 = tf.block(0,0,3,3);
    }




    if (query_type.compare("IK")==0)
    {
        Eigen::Map<Eigen::ArrayXXd,Eigen::Aligned> target (mxGetPr(mex_in[2]),4,4);
        // IK
        IkSolutionList<IkReal> solutions;

        // Free link indices. Not needed for this robot. 6DOF
        std::vector<IkReal> vfree(GetNumFreeParameters());
        for(std::size_t i = 0; i < vfree.size(); ++i)
            vfree[i] = ptr_free_links[i];
            
        // Convert to IKfast datatypes
        IkReal eerot[9],eetrans[3];
        eerot[0] = target(0,0); eerot[1] = target(0,1); eerot[2] = target(0,2);
        eerot[3] = target(1,0); eerot[4] = target(1,1); eerot[5] = target(1,2);
        eerot[6] = target(2,0); eerot[7] = target(2,1); eerot[8] = target(2,2);

        eetrans[0] = target(0,3); eetrans[1] = target(1,3); eetrans[2] = target(2,3);
        // IK
        bool bSuccess = ComputeIk(eetrans, eerot, vfree.size() > 0 ? &vfree[0] : NULL, solutions);
        
        int no_sols = solutions.GetNumSolutions();
        Eigen::MatrixXd sol_mat(no_sols,dof);

        std::vector < IkReal > solvalues(dof);
        std::vector < double > temp_sols(dof);         
        for (int i=0; i<no_sols; i++)
        {
            const IkSolutionBase<IkReal>& sol = solutions.GetSolution(i);
            std::vector<IkReal> vsolfree(sol.GetFree().size());
            sol.GetSolution(&solvalues[0],vsolfree.size()>0?&vsolfree[0]:NULL);
            temp_sols = static_cast<std::vector<double>> (solvalues);
            // std::cout<< temp_sols[0] << " , " << temp_sols[1] << " , " << std::endl;
            sol_mat.row(i) = Eigen::VectorXd::Map(&temp_sols[0], temp_sols.size());
        }
        
        // /////////////////// OUTPUT ///////////////////////////////////
        mex_op[0] = mxCreateLogicalScalar(bSuccess);
        mex_op[1] = mxCreateDoubleScalar(no_sols);
        mex_op[2] = mxCreateDoubleMatrix(no_sols,dof, mxREAL);
        Eigen::Map<Eigen::ArrayXXd,Eigen::Aligned> M0 (mxGetPr(mex_op[2]),no_sols,dof);
        M0 = sol_mat.block(0,0,no_sols-1,dof-1);
    }
    
    return;
}

